function Career() {
  return (
    <div className="container">
      <h1>Careers </h1>

      <ul>
        <li>Real-world projects</li>
        <li>Learning new technologies</li>
        <li>Exploring career paths</li>
      </ul>

      <button className="btn-primary">Send Resume</button>
    </div>
  );
}

export default Career;
